import React from 'react';
import { Link, useNavigate } from 'react-router-dom';

const Dashboard = () => {
  const navigate = useNavigate(); // Initialize navigate function

  const handleLogout = () => {
    // Perform logout logic here (e.g., clear user token from local storage)
    localStorage.removeItem('userToken');

    // Redirect to registration page after logout
    navigate('/register');
  };

  return (
    <div>
      <h1>Welcome to Dashboard</h1>
      <div className="d-flex justify-content-around">
        <h2>Welcome, User!</h2>
      </div>
      <button onClick={handleLogout} className="btn btn-link text-danger">Logout</button>
      <div className="d-flex justify-content-center">
        <h1><Link to="/nominee/dashboard">Nominator Dashboard</Link></h1>
      </div>
      <div className="d-flex justify-content-center">
        <h1><Link to="/recommender/dashboard">Recommender Dashboard</Link></h1>
      </div>
      <div className="d-flex justify-content-center">
        <h1><Link to="/review/dashboard">Review Committee Dashboard</Link></h1>
      </div>
    </div>
  );
};

export default Dashboard;
